const style = {
  padding: "14px 27px",
  outline: "none",
  cursor: "pointer",
  borderRadius: "9999px",
  fontSize: "17px",
};

function Button({ children, onClick }) {
  return (
    <button style={style} onClick={onClick}>
      {children}
    </button>
  );
}

export default Button;
